//importing XmlHolder
import com.eviware.soapui.support.XmlHolder

//fetching and keeping response
def response = context.testCase.getTestStepByName('CreateCustomer').getPropertyValue("response")
//it stores all response
def holder = new XmlHolder(response)
//fetching customer id created in response
def custid = holder.getNodeValue("//*:result/id")
//applying this in test case custome property
context.testCase.setPropertyValue("custid",custid)
